import styled from "styled-components";

export const Button = styled.button`
  margin-left: 20px;
  background-color: white;
  border-radius: 5px;
  cursor: pointer;
`;

export const ListItem = styled.li`
  :not(:last-child) {
    margin-bottom: 20px;
  }
`;
